import { createRouter, createWebHistory } from 'vue-router';
import FiveDayView from '@/views/5Day.vue';
import MySavedLocationsView from '@/views/MySavedLocations.vue';

const routes = [
  { path: '/5day:location', name: 'FiveDayView', component: FiveDayView }, 
  { path: '/saved', name: 'MySavedLocationsView', component: MySavedLocationsView }, 
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
